'use client'

import { motion } from 'framer-motion'
import { useInView } from 'react-intersection-observer'
import { ArrowRight } from 'lucide-react'
import Carousel from './Carousel'

const collageImages = [
  { src: 'https://th.bing.com/th?id=OIP.pFTVBh1F93ZFx4bPv_NYMAHaFj&w=288&h=216&c=8&rs=1&qlt=90&o=6&pid=3.1&rm=2', alt: 'Web Design Project 1' },
  { src: 'data:image/jpeg;base64,', alt: 'Mobile App Project' },
  { src: 'https://th.bing.com/th/id/OIP.YiiVg7ESQZ8-Be5rb6nTAAHaFj?w=244&h=183&c=7&r=0&o=5&pid=1.7', alt: 'UI/UX Design Project' },
  { src: 'data:image/jpeg;base64,', alt: 'E-commerce Project' },
  { src: 'data:image/jpeg;base64,', alt: 'Branding Project' },
  { src: 'https://th.bing.com/th/id/OIP.bOqP25IgWVjFiGGB--dP0AHaE8?w=248&h=180&c=7&r=0&o=5&pid=1.7', alt: 'Web Development Project 2' },
]

export default function Hero() {
  const [ref, inView] = useInView({
    triggerOnce: false,
    threshold: 0.1,
  })

  return (
    <section id="home" className="bg-gradient-to-br from-blue-600 to-purple-700 text-white py-20 lg:h-screen">
      <div className="relative container mx-auto px-4 py-3 z-[10] mt-[22px]">
        <div className="flex flex-col lg:flex-row items-center justify-between">
          <motion.div
            className="lg:w-1/2 mb-10 lg:mb-0"
            ref={ref}
            initial={{ opacity: 0, x: -50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ duration: 0.5 }}
          >
            <h1 className="text-4xl md:text-5xl lg:text-6xl font-bold mb-6 leading-tight">
              Crafting Digital{' '}
              <span className="bg-clip-text text-transparent bg-gradient-to-r from-yellow-400 to-orange-500">
                Experiences
              </span>{' '}
              That Inspire
            </h1>
            <p className="text-xl mb-8 ml-4 text-gray-200">
              We build stunning websites and applications that drive results for your business. Let's bring your vision to life.
            </p>
            <motion.a
              href="#contact"
              className="inline-flex items-center px-6 py-3 rounded-full bg-white text-blue-600 font-semibold text-lg hover:bg-blue-100 transition duration-300"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              Get Started
              <ArrowRight className="ml-2 h-5 w-5" />
            </motion.a>
          </motion.div>
          <motion.div
            className="lg:w-1/2"
            ref={ref}
            initial={{ opacity: 0, y: 50 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.5, delay: 0.2 }}
          >
            <div className="grid grid-cols-2 md:grid-cols-3 gap-4 bg-contain">
              {collageImages.map((image, index) => (
                <motion.div
                  key={index}
                  className="relative overflow-hidden rounded-lg shadow-lg"
                  whileHover={{ scale: 1.05, zIndex: 1 }}
                  transition={{ duration: 0.3 }}
                >
                  <img
                    src={image.src}
                    alt={image.alt}
                    className="w-full h-full object-cover"
                  />
                  <motion.div
                    className="absolute inset-0 bg-gradient-to-t from-black/70 to-transparent opacity-0 transition-opacity duration-300"
                    whileHover={{ opacity: 1 }}
                  >
                    <p className="absolute bottom-2 left-2 text-white text-sm font-medium">
                      {image.alt}
                    </p>
                  </motion.div>
                </motion.div>
              ))}
            </div>
          </motion.div>
        </div>
      </div>
      <motion.div
            className='hidden lg:inline-block'
            initial={{ opacity: 0 }}
            animate={inView ? { opacity: 1 } : {}}
            transition={{ duration: 1.5, delay: 0.5 }}
          >
              <Carousel/>
        </motion.div>
    </section>
  )
}



